            width="600" height="450" style={{ border: "10" }} allowFullScreen="" loading="lazy"
            referrerPolicy="no-referrer-when-downgrade">
        </iframe>
    )

  return (
    <>
      <GreenPageHeader title="Contact us" />
      <Map style={{ alignSelf: 'center' }}/>
    </>
  );
};

export default ContactUsContainer;
